Blue 1999


Blue is the second album by Third Eye Blind, written and recorded in 1999 and released on November 23, 1999. It is a moodier, darker album than the band's first, though the second single was the radio-friendly &quot;Never Let You Go&quot;. The album debuted at #40 on the Billboard 200 charts, selling about 75,000 copies in its first week of release.[1] Blue has been certified platinum by the RIAA, selling about 1.25 million copies in the U.S.[1][2]

During the band's tour shortly after the release of Blue, Kevin Cadogan was released from the band on January 25, 2000.[3] Tony Fredianelli, who had some limited experience with the band previously, joined the band shortly thereafter. Cadogan subsequently sued Third Eye Blind for breach of contract, with a settlement of an undisclosed amount permanently ending the relationship.


